# Matriz usada para cadastrar a lista de produtos pr definidos
produtos = [
[306, 'TV LG 50', 3200.00],
[721, 'Geladeira Brastemp 800', 7800.00],
[485, 'Forno Eletrico GE 40', 850.00],
[961, 'Geladeira Consul 500', 2600.00],
[388, 'TV Philips 60', 4500.00]
]

# Funo para listar os produtos registrados
def listar(produtos):
  for i in produtos:
    print(f'Cdigo: {i[0]} - Descrio: {i[1]} - Preo: {i[2]}\n')

# Funo para inserios novos produtos na Matriz
def inserir(produtos):
    codigo = int(input('Digite o cdigo do produto: '))
    descricao = input('Digite a descrio do produto: ')
    preco = float(input('Digite o preo do produto: '))
    produtos.append([codigo, descricao, preco])

# Funo para atualizar os produtos na Matriz
def atualizar(produtos):
    codigo = int(input('Digite o cdigo do produto que deseja atualizar: '))
    for i in produtos:
        if i[0] == codigo:
            novo_preco = float(input('Digite o novo preo do produto: '))
            i[2] = novo_preco
        else:
            print("produto no encontrado.")
            break

# Funo para excluir os produtos na Matriz
def excluir(produtos):
    codigo = int(input('Digite o cdigo do produto que deseja excluir: '))
    for i in produtos:
        if i[0] == codigo:
            produtos.remove(i)

# Funo para buscar as informaes de determinado produto solicitado pelo usurio
def buscar_descricao(produtos):
    descricao = input('Digite a descrio do produto que deseja buscar: ').lower()
    for i in produtos:
        if descricao in i[1].lower():
            print(f'Cdigo: {i[0]} - Descrio: {i[1]} - Preo: {i[2]}')

# Funo para encontrar os preos dos produtos dentro do intervalo inserido pelo usurio
def buscar_preco(produtos):
  minimo = float(input('Digite o preo mnimo que deseja buscar: '))
  maximo = float(input('Digite o preo mximo que deseja buscar: '))

  for i in produtos:
    if i[2] >= minimo and i[2] <= maximo:
      print(f'Cdigo: {i[0]} - Descrio: {i[1]} - Preo: {i[2]}')

# Funo que inicializa o programa apresentando o MENU de opes para o usurio escolher.
def inicializar():
    while True:
        print('\noperaes disponveis:\n')
        print('1. listar catlogo.')
        print('2. inserir produto.')
        print('3. atualizar preo.')
        print('4. excluir pelo cdigo.')
        print('5. buscar produto pela descrio.')
        print('6. buscar produto pelo preo.')
        print('0. sair.\n')


        escolha = int(input('escolha uma opo: \n'))

        if escolha == 0:
            break
        elif escolha == 1:
            listar(produtos)
        elif escolha == 2:
            inserir(produtos)
        elif escolha == 3:
            atualizar(produtos)
        elif escolha == 4:
            excluir(produtos)
        elif escolha == 5:
            buscar_descricao(produtos)
        elif escolha == 6:
            buscar_preco(produtos)
        else:
            print('Opo invlida. Tente novamente.')


inicializar()

